import React from 'react';
import Navbar from '../components/Navbar';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Routes>
          <Route path='/'  />
          {/* You can add more routes here, like */}
          {/* <Route path='/about' element={<About />} /> */}
        </Routes>
      </Router>
    </>
  );
}

export default App;
